(1, 1, '2017-03-22 14:37:12', '2017-03-22 13:37:12', '<strong>Lorem Ipsum</strong> är en utfyllnadstext från tryck- och förlagsindustrin. Lorem ipsum har varit standard ända sedan 1500-talet, när en okänd boksättare tog att antal bokstäver och blandade dem för att göra ett provexemplar av en bok. Lorem ipsum har inte bara överlevt fem århundraden, utan även övergången till elektronisk typografi utan större förändringar. Det blev allmänt känt på 1960-talet i samband med lanseringen av Letraset-ark med avsnitt av Lorem Ipsum, och senare med mjukvaror som Aldus PageMaker.\r\n\r\nDet är ett välkänt faktum att läsare distraheras av läsbar text på en sida när man skall studera layouten. Poängen med Lorem Ipsum är att det ger ett normalt ordflöde, till skillnad från "Text här, Text här", och ger intryck av att vara läsbar text. Många publiseringprogram och webbutvecklare använder Lorem Ipsum som test-text, och en sökning efter "Lorem Ipsum" avslöjar många webbsidor under uteckling. Olika versioner har dykt upp under åren, ibland av olyckshändelse, ibland med flit (mer eller mindre humoristiska).', 'Att vara jag...', '', 'publish', 'open', 'open', '', 'hej-varlden', '', '', '2017-04-07 04:34:35', '2017-04-07 02:34:35', '', 0, 'http://localhost/wptenta/?p=1', 0, 'post', '', 1),
(2, 1, '2017-03-22 14:37:12', '2017-03-22 13:37:12', 'Detta är en exempelsida. Den skiljer sig från ett blogginlägg eftersom den är statisk och kommer att finnas på samma plats hela tiden, den kommer troligen att visas i din sidnavigering (i de flesta teman). De flesta börjar med en Om-sida som introducerar dem för potentiella besökare. Den skulle t.ex kunna ha följande innehåll: \n\n<blockquote> Hej där! Jag är cykelbud på dagen, blivande skådespelare på natten och detta är min blogg. Jag bor i Örebro, har en katt som heter Lurv och jag gillar mitt morgonkaffe (och att simma i Göta kanal).</blockquote>\n\n... eller något liknande detta:\n\n<blockquote>Den officiella svenska portalen för WordPress, WordPress Sverige grundades 2007 och tillhandahåller svenska översättningar för WordPress, teman och tillägg. Behöver man hjälp med att komma igång eller stöter på problem så är WordPress Sverige den perfekta platsen att få svensk support på. Du hittar portalen på wpsv.se.</blockquote>\n\nSom ny WordPress-användare bör du gå till <a href="http://localhost/wptenta/wp-admin/">din adminpanel</a> för att ta bort denna sida och sedan skapa nya sidor för ditt innehåll. Ha det så kul!', 'Exempelsida', '', 'trash', 'closed', 'open', '', 'exempelsida__trashed', '', '', '2017-04-05 11:05:09', '2017-04-05 09:05:09', '', 0, 'http://localhost/wptenta/?page_id=2', 0, 'page', '', 0),
