(78, 1, '2017-04-06 11:12:31', '2017-04-06 09:12:31', 'Här kommer Pippi Långstrump, tjolahopp tjolahej tjolahoppsan sa. Här kommer Pippi Långstrump,&nbsp;ja här kommer faktiskt jag.&nbsp;\r\nHar du sett min apa,&nbsp;min lilla söta fina apa.&nbsp;Har du sett herr Nilsson,&nbsp;ja han heter faktiskt så. &nbsp;Har du sett min villa, &nbsp;min Villa Villekulla villa.&nbsp;Vill å vill du veta&nbsp;varför villan heter så?\r\n\r\nJo, för där bor ju Pippi Långstrump, &nbsp;tjolahopp tjolahej tjolahoppsan sa. Där bor ju Pippi Långstrump,&nbsp;ja där bor faktiskt jag.&nbsp;\r\nDet är inte illa&nbsp;jag har apa, häst och villa. En kappsäck full av pengar&nbsp;är det också bra att ha.&nbsp;Kom nu alla vänner,&nbsp;varenda kotte som jag känner.&nbsp;Nu ska vi leva loppan,&nbsp;tjolahej tjolahoppsan sa.\r\n\r\nHär kommer Pippi Långstrump,&nbsp;tjolahopp tjolahej tjolahoppsan sa.&nbsp;Här kommer Pippi Långstrump,&nbsp;ja här kommer faktiskt jag.\r\n\r\n&nbsp;\r\n\r\n<img class="alignnone size-medium wp-image-102" src="http://localhost/wptenta/wp-content/uploads/2017/04/tecknad-ren-disk-vektor_34-30049_530a7cefe087c3119eb199b7_57c050549606ee59ce38803c-300x183.jpg" alt="" width="300" height="183">', 'Livet efter 40', '', 'publish', 'open', 'open', '', 'livet-efter-40', '', '', '2017-04-07 04:49:42', '2017-04-07 02:49:42', '', 0, 'http://localhost/wptenta/?p=78', 0, 'post', '', 0),
