(94, 1, '2017-04-06 14:21:15', '2017-04-06 12:21:15', 'Svårigheten med att skriva om sitt eget liv har alltid varit att veta var man ska starta och hur man fortsätter. Man är osäker i början; "vad ska jag skriva här?" &nbsp;Finns det regler att följa när jag ska beskriva mig själv? Det bästa är att &nbsp;vara så konkret som möjligt. Men vad gör man när inspirationen är obefintlig, och man faktiskt inte kommer på något att skriva? Bästa lösningen: fråga vännerna!\r\n\r\nOm man inte vet hur man ska gå tillväga kan man lita på deras omdöme. Vänner är ofta mera storsinta i bedömningen än man själv; de ser älskvärda eller speciella aspekter av personligheten som man själv aldrig skulle ha lagt märke till. Att använda vardagliga situationer som associationshjälp är bra. Fråga sig vad jag själv gärna skulle vilja veta om en främling och ge en likadan upplysning om sig själv. Man kan försöka om möjligt att "sortera in" sig i olika grupper för att uttrycka vad som särskiljer mig från andra; "storstadsmänniska, ingen lantis", "entusiastisk hobbymixtrare", "ingen sport!".\r\n\r\nFrågan till slut: hur är jag i vardagen, vad är min stil och vad är typiskt?\r\n\r\nNågot att fundera på...', 'Om mig', '', 'inherit', 'closed', 'closed', '', '10-revision-v1', '', '', '2017-04-06 14:21:15', '2017-04-06 12:21:15', '', 10, 'http://localhost/wptenta/2017/04/06/10-revision-v1/', 0, 'revision', '', 0),
