(108, 1, '2017-04-07 04:48:47', '2017-04-07 02:48:47', 'Här kommer Pippi Långstrump, tjolahopp tjolahej tjolahoppsan sa. Här kommer Pippi Långstrump,&nbsp;ja här kommer faktiskt jag.&nbsp;\nHar du sett min apa,&nbsp;min lilla söta fina apa.&nbsp;Har du sett herr Nilsson,&nbsp;ja han heter faktiskt så. &nbsp;Har du sett min villa, &nbsp;min Villa Villekulla villa.&nbsp;Vill å vill du veta&nbsp;varför villan heter så?\n\nJo, för där bor ju Pippi Långstrump, &nbsp;tjolahopp tjolahej tjolahoppsan sa. Där bor ju Pippi Långstrump,\nja där bor faktiskt jag.\n\nDet är inte illa\njag har apa, häst och villa.\nEn kappsäck full av pengar\när det också bra att ha.\nKom nu alla vänner,\nvarenda kotte som jag känner.\nNu ska vi leva loppan,\ntjolahej tjolahoppsan sa.\n\nHär kommer Pippi Långstrump,\ntjolahopp tjolahej tjolahoppsan sa.\nHär kommer Pippi Långstrump,\nja här kommer faktiskt jag.\n\n&nbsp;\n\n<img class="alignnone size-medium wp-image-102" src="http://localhost/wptenta/wp-content/uploads/2017/04/tecknad-ren-disk-vektor_34-30049_530a7cefe087c3119eb199b7_57c050549606ee59ce38803c-300x183.jpg" alt="" width="300" height="183">', 'Livet efter 40', '', 'inherit', 'closed', 'closed', '', '78-autosave-v1', '', '', '2017-04-07 04:48:47', '2017-04-07 02:48:47', '', 78, 'http://localhost/wptenta/2017/04/07/78-autosave-v1/', 0, 'revision', '', 0),
