(112, 1, '2017-04-07 04:47:01', '2017-04-07 02:47:01', 'Här kommer Pippi Långstrump, tjolahopp tjolahej tjolahoppsan sa.&nbsp;Här kommer Pippi Långstrump, ja här kommer faktiskt jag.\r\nHar du sett min apa, min lilla söta fina apa. Har du sett herr Nilsson, ja han heter faktiskt så. Har du sett min villa, min Villa Villekulla villa.\r\nVill å vill du veta varför villan heter så?\r\n\r\nDet är inte illa jag har apa, häst och villa.&nbsp;En kappsäck full av pengar&nbsp;är det också bra att ha.&nbsp;Kom nu alla vänner,&nbsp;varenda kotte som jag känner.&nbsp;Nu ska vi leva loppan,&nbsp;tjolahej tjolahoppsan sa.&nbsp;\r\n\r\nJo, för där bor ju Pippi Långstrump, tjolahopp tjolahej tjolahoppsan sa. Där bor ju Pippi Långstrump, ja där bor faktiskt jag.\r\n\r\n&nbsp;\r\n\r\n<img class="alignnone size-medium wp-image-102" src="http://localhost/wptenta/wp-content/uploads/2017/04/tecknad-ren-disk-vektor_34-30049_530a7cefe087c3119eb199b7_57c050549606ee59ce38803c-300x183.jpg" alt="" width="300" height="183">', 'Livet efter 40', '', 'inherit', 'closed', 'closed', '', '78-revision-v1', '', '', '2017-04-07 04:47:01', '2017-04-07 02:47:01', '', 78, 'http://localhost/wptenta/2017/04/07/78-revision-v1/', 0, 'revision', '', 0),
(113, 1, '2017-04-07 04:49:42', '2017-04-07 02:49:42', 'Här kommer Pippi Långstrump, tjolahopp tjolahej tjolahoppsan sa. Här kommer Pippi Långstrump,&nbsp;ja här kommer faktiskt jag.&nbsp;\r\nHar du sett min apa,&nbsp;min lilla söta fina apa.&nbsp;Har du sett herr Nilsson,&nbsp;ja han heter faktiskt så. &nbsp;Har du sett min villa, &nbsp;min Villa Villekulla villa.&nbsp;Vill å vill du veta&nbsp;varför villan heter så?\r\n\r\nJo, för där bor ju Pippi Långstrump, &nbsp;tjolahopp tjolahej tjolahoppsan sa. Där bor ju Pippi Långstrump,&nbsp;ja där bor faktiskt jag.&nbsp;\r\nDet är inte illa&nbsp;jag har apa, häst och villa. En kappsäck full av pengar&nbsp;är det också bra att ha.&nbsp;Kom nu alla vänner,&nbsp;varenda kotte som jag känner.&nbsp;Nu ska vi leva loppan,&nbsp;tjolahej tjolahoppsan sa.\r\n\r\nHär kommer Pippi Långstrump,&nbsp;tjolahopp tjolahej tjolahoppsan sa.&nbsp;Här kommer Pippi Långstrump,&nbsp;ja här kommer faktiskt jag.\r\n\r\n&nbsp;\r\n\r\n<img class="alignnone size-medium wp-image-102" src="http://localhost/wptenta/wp-content/uploads/2017/04/tecknad-ren-disk-vektor_34-30049_530a7cefe087c3119eb199b7_57c050549606ee59ce38803c-300x183.jpg" alt="" width="300" height="183">', 'Livet efter 40', '', 'inherit', 'closed', 'closed', '', '78-revision-v1', '', '', '2017-04-07 04:49:42', '2017-04-07 02:49:42', '', 78, 'http://localhost/wptenta/2017/04/07/78-revision-v1/', 0, 'revision', '', 0);
